import { Component } from '@angular/core';

import { CoreConstants } from '@/core/constants';
import { CoreSites } from '@services/sites';
import { CoreNavigator } from '@services/navigator';
import { CoreSite } from '@classes/sites/site';

/**
 * App settings about menu page.
 */
@Component({
    selector: 'page-core-app-settings-about',
    templateUrl: 'about.html',
    styleUrls: ['about.scss'],
})
export class CoreSettingsAboutPage {

    appName: string;
    versionName: string;
    privacyPolicy: string;
    feedbackFormUrl = CoreConstants.CONFIG.feedbackFormUrl ?? 'https://feedback.moodle.org/mobileapp';
    a11yStatement = CoreConstants.CONFIG.a11yStatement ?? 'https://apps.moodle.com/admin/tool/policy/view.php?versionid=5';
    currentSite?: CoreSite;
    showSurvey: boolean | undefined = false;
    legalDisclaimer = CoreConstants.CONFIG.legalDisclaimer;

    constructor() {
        this.currentSite = CoreSites.getCurrentSite();

        this.appName = CoreConstants.CONFIG.appname;
        this.versionName = CoreConstants.CONFIG.versionname;

        // Calculate the privacy policy to use.
        this.privacyPolicy = (this.currentSite && (this.currentSite.getStoredConfig('tool_mobile_apppolicy') ||
        this.currentSite.getStoredConfig('sitepolicy'))) || CoreConstants.CONFIG.privacypolicy;
        this.showSurvey = this.currentSite?.isAdmin();
    }

    /**
     * Opens a page.
     *
     * @param page The component deeplink name you want to push onto the navigation stack.
     */
    openPage(page: string): void {
        CoreNavigator.navigate(page);
    }

}
<ion-header>
    <ion-toolbar>
        <ion-buttons slot="start">
            <ion-back-button [text]="'core.back' | translate" />
        </ion-buttons>
        <ion-title>
            <h1>
                {{ 'core.settings.about' | translate}}
            </h1>
        </ion-title>
    </ion-toolbar>
</ion-header>

<ion-content>
    <ion-list class="list-item-limited-width">
        <ion-item button class="ion-text-wrap" (click)="openPage('licenses')" [detail]="true">
            <ion-icon name="far-copyright" slot="start" aria-hidden="true" />
            <ion-label>{{ 'core.settings.opensourcelicenses' | translate }}</ion-label>
        </ion-item>
        <ion-item *ngIf="privacyPolicy" class="ion-text-wrap" button core-link auto-login="no" [href]="privacyPolicy" [detail]="true"
            detailIcon="open-outline">
            <ion-icon name="fas-user-shield" slot="start" aria-hidden="true" />
            <ion-label>{{ 'core.settings.privacypolicy' | translate }}</ion-label>
        </ion-item>
        <ion-item *ngIf="a11yStatement" class="ion-text-wrap" button core-link auto-login="no" [href]="a11yStatement" [detail]="true"
            detailIcon="open-outline">
            <ion-icon name="fas-universal-access" slot="start" aria-hidden="true" />
            <ion-label>{{ 'core.settings.accessstatement' | translate }}</ion-label>
        </ion-item>
        <ion-item *ngIf="currentSite && feedbackFormUrl && showSurvey" class="ion-text-wrap" button core-link [href]="feedbackFormUrl"
            [detail]="true" detailIcon="open-outline">
            <ion-icon name="fas-bullhorn" slot="start" aria-hidden="true" />
            <ion-label>{{ 'core.settings.helpusimprove' | translate }}</ion-label>
        </ion-item>
        <ion-item *ngIf="legalDisclaimer" class="ion-text-wrap" button core-link auto-login="no" [href]="legalDisclaimer" [detail]="true"
            detailIcon="open-outline">
            <ion-icon name="fas-scale-balanced" slot="start" aria-hidden="true" />
            <ion-label>{{ 'core.settings.legaldisclaimer' | translate }}</ion-label>
        </ion-item>
    </ion-list>
</ion-content>

<ion-footer class="ion-no-border">
    <ion-item button class="ion-text-wrap ion-text-center core-about-deviceinfo" [detail]="false" (click)="openPage('deviceinfo')">
        <ion-label>
            <p class="item-heading">{{ appName }} {{ versionName }}</p>
        </ion-label>
    </ion-item>
</ion-footer>
